      SELECT - + ( ( + COALESCE ( + 97, + + 18 + + 95 + + - COUNT ( * ) * + 60 + - CAST ( - + COUNT ( * ) AS INTEGER ) * 44, + + 13 ) ) ) / - MAX ( - 86 ) AS col2;

outputs:
  - name: q9512.out
    data: |
      -1
